I have a list of strings, and I want to sort them in case-sensative way. For example, I have a list of strings: ["a", "A", "b", "B", "c", "C"] and I want to sort them in case-sensative way, so the result will be: ["A", "a", "B", "b", "C", "c"] . How can I do that?
You can use Array.prototype.sort() and pass a function that compares the strings in a case-sensitive way:
const strings = ["a", "A", "b", "B", "c", "C"];
strings.sort((a, b) => a.localeCompare(b, undefined, {sensitivity: 'case'}));
console.log(strings);
